import React from 'react'
import '../styles/chat.css'
import ChatBot from 'react-simple-chatbot';
function chat() {
    const steps = [
        {
            id: '0',
            message: 'Hey Geek!',
            end: true
        }
    ];
    const theme = {
        background: '#C9FF8F',
        headerBgColor: '#197B22',
        headerFontSize: '20px',
        botBubbleColor: '#0F3789',
        headerFontColor: 'white',
        botFontColor: 'white',
        userBubbleColor: '#FF5733',
        userFontColor: 'white',
    };
     
  return (
   
       
            <div className="App">
                <h1>Welcome to Geeksforgeeks</h1>
                <ChatBot steps={steps} />
            </div>
          

        );
    }
    

export default chat
